import React from 'react';
import styled from 'styled-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
  faTachometerAlt,
  faDatabase,
  faBrain,
  faChartBar,
  faCog,
  faRocket
} from '@fortawesome/free-solid-svg-icons';

const NavigationContainer = styled.div`
  background: white;
  border-radius: 12px;
  padding: 20px 0;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  height: fit-content;
`;

const NavigationHeader = styled.div`
  padding: 0 20px 20px 20px;
  border-bottom: 1px solid #e9ecef;
  margin-bottom: 20px;
  
  h3 {
    margin: 0;
    color: #333;
    font-size: 1.1rem;
    font-weight: 600;
  }
  
  p {
    margin: 5px 0 0 0;
    color: #6c757d;
    font-size: 0.9rem;
  }
`;

const NavigationList = styled.ul`
  list-style: none;
  padding: 0;
  margin: 0;
`;

const NavigationItem = styled.li`
  margin: 0;
`;

const NavigationLink = styled.button`
  width: 100%;
  background: none;
  border: none;
  padding: 12px 20px;
  text-align: left;
  cursor: pointer;
  transition: all 0.2s ease;
  display: flex;
  align-items: center;
  gap: 12px;
  font-size: 0.95rem;
  color: ${props => props.active ? '#667eea' : '#495057'};
  background: ${props => props.active ? 'rgba(102, 126, 234, 0.1)' : 'transparent'};
  border-left: ${props => props.active ? '3px solid #667eea' : '3px solid transparent'};
  
  &:hover {
    background: ${props => props.active ? 'rgba(102, 126, 234, 0.1)' : 'rgba(0, 0, 0, 0.05)'};
    color: ${props => props.active ? '#667eea' : '#333'};
  }
  
  .icon {
    width: 18px;
    text-align: center;
    color: ${props => props.active ? '#667eea' : '#6c757d'};
  }
  
  .label {
    font-weight: ${props => props.active ? '600' : '400'};
  }
  
  .badge {
    margin-left: auto;
    background: #667eea;
    color: white;
    font-size: 0.7rem;
    padding: 2px 6px;
    border-radius: 10px;
    font-weight: 500;
  }
`;

const Navigation = ({ activeSection, onSectionChange }) => {
  const navigationItems = [
    {
      id: 'dashboard',
      label: 'Dashboard',
      icon: faTachometerAlt,
      badge: 'Active'
    },
    {
      id: 'datasets',
      label: 'Datasets',
      icon: faDatabase,
      badge: 'Soon'
    },
    {
      id: 'models',
      label: 'AI Models',
      icon: faBrain,
      badge: 'Soon'
    },
    {
      id: 'analytics',
      label: 'Analytics',
      icon: faChartBar,
      badge: 'Soon'
    },
    {
      id: 'settings',
      label: 'Settings',
      icon: faCog,
      badge: 'Soon'
    }
  ];

  return (
    <NavigationContainer>
      <NavigationHeader>
        <h3>
          <FontAwesomeIcon icon={faRocket} style={{ color: '#667eea', marginRight: '8px' }} />
          Multimodal AI
        </h3>
        <p>Tactile-Vision-Text Platform</p>
      </NavigationHeader>
      
      <NavigationList>
        {navigationItems.map((item) => (
          <NavigationItem key={item.id}>
            <NavigationLink
              active={activeSection === item.id}
              onClick={() => onSectionChange(item.id)}
              disabled={item.id !== 'dashboard'}
            >
              <FontAwesomeIcon icon={item.icon} className="icon" />
              <span className="label">{item.label}</span>
              {item.badge && (
                <span className="badge">
                  {item.badge}
                </span>
              )}
            </NavigationLink>
          </NavigationItem>
        ))}
      </NavigationList>
    </NavigationContainer>
  );
};

export default Navigation;
